//5. Create a Note.jsx component to show a <div> element with a
//<h1> for a title and a <p> for the content.

import React from "react";
import ReactDOM from "react-dom";

function Note(){
    ReactDOM.render(
        <div>
        <h1>Title</h1>
        <p>Content</p>
        </div>,
        document.getElementById("root")
      );
    };
    
    export default Note;
